import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div>
      <div>Your todo`s</div>
      <div>
        <table>
          <thead>
            <tr>
              <th scope='col'>#</th>
              <th scope='col'>Description</th>
              <th scope='col'>Assigned</th>
            </tr>
          </thead>
          <tbody></tbody>
        </table>
      </div>
    </div>
  );
}

export default App;
